import React from "react";

function Backstage() {
  const [title, setTitle] = React.useState("");
  return (
    <div className="rooms__backstage">
      上架露營地
      <div className="rooms__backstage__title">
        <input
          className="rooms__backstage__input"
          placeholder="露營地名稱"
          value={title}
          onChange={(e) => setTitle(e.target.value)}
        />
      </div>
    </div>
  );
}

export default Backstage;
